DESCRICAO:
O Presidente da CIPA é escolhido pelo empregador dentre seus representantes. O presidente da CIPA será substituído pelo vice-presidente nos seus  impedimentos eventuais ou afastamentos temporários.
Compete ao Presidente da CIPA:
- Convocar os membros para a reuniãoda CIPA;
- Presidir as reuniões,  encaminhando ao empregador e ao SESMT as recomendações aprovadas e acompanhar sua execução;
- Designar ummembro da cipa ou grupo partidário para investigar e/ou acompanhar o acidente de trabalho;
- Determinar tarefas aos membros da CIPA;
- Coordenar as atribuições da CIPA;
- Manter e Promover o relacionamento da CIPA com o SESMT e demais orgãos da empresa;
- Delegar atribuições ao vice-presidednte.

